const initialData=0;

const changeTheNumber=(state={initialData},action)=>{
  
    switch(action.type){
        case "INCREMENT" :return state=state++; 
        case "DECREMENT" :return state=state-1; 
        default:return state;
        
    }


}

export default changeTheNumber;
